var loader = {

    show: function(callback)
    {
        $('.preloader').fadeIn(function()
        {
            if ('function' === typeof callback)
            {
                callback();
            }
        });
    },

    hide: function(callback)
    {
        $('.preloader').fadeOut(function()
        {
            if ('function' === typeof callback)
            {
                callback();
            }
        });
    }
};


// Add slideDown animation to dropdown

window.onload = function()
{
    


    $('.dropdown').on('show.bs.dropdown', function(e)
    {
        $(this).find('.dropdown-menu').first().stop(true, true).slideDown(200);
    });


    $('.dropdown').on('hide.bs.dropdown', function(e)
    {
        $(this).find('.dropdown-menu').first().stop(true, true).slideUp(200);
    });

    var hasShrunk = false;

    if ($(window).width() > 768) {
        
        window.onscroll = function() {scrollFunction()};

        function scrollFunction() 
        {

            if (document.body.scrollTop > 90 || document.documentElement.scrollTop > 90) 
            {
            
               
                $(".uxjason-header-logo").css({"max-height" : "40px", "transition": "max-height 0.3s ease-in-out" }, {queue: false });
            }
            else 
            {
                $(".uxjason-header-logo").css({"max-height" : "75px", "transition": "max-height 0.3s ease-in-out"  }, {queue: false });
            }
        }
    }
};

$(window).scroll(function() 
    
    {    
        var scroll = $(window).scrollTop();

        if (scroll >= 50) 
        {
           $(".navbar-brand").addClass("rotate");
        }
        else
        {
           $(".navbar-brand").removeClass("rotate"); 
        }
    });



// // Footer chevron scroll mobile
$('#footer-chevron-scroll-mobile').click(function(event) 
{
    $('html, body').animate({ scrollTop: 0 }, 600);
    
    return false;
});

// Footer chevron scroll
$('#footer-chevron-scroll').click(function(event) 
{
    $('html, body').animate({ scrollTop: 0 }, 600);

    return false;
});


// Portfolio modal https://www.w3schools.com/howto/howto_css_modal_images.asp

window.onload = function()
{
if(document.getElementById("myModal"))
{

    var modal = document.querySelectorAll(".myModal");

    var portfolioImg = document.querySelectorAll(".portfolio-image");

    var modalImg = document.getElementById("modalImage");

    var captionText = document.getElementById("caption");


    for (i = 0; i < portfolioImg.length; ++i) 
    {

        portfolioImg[i].onclick = function()
        {
          modal.style.display = "block";
          modalImg.src = this.src;
          captionText.innerHTML = this.alt;
        }

    }

    var modal = document.getElementById('myModal');

    modal.addEventListener('click',function()
    {
        this.style.display = "none";
    });

    var span = document.getElementsByClassName("close-modal")[0];

    span.onclick = function() 
    { 
      modal.style.display = "none";
    }
}
}

// 'use strict';

$(function(){

	if($('#naso-designs-form').length > 0){ 
			
		$('#naso-designs-form').formValidation({
			framework: 'bootstrap',  
			icon: {
				valid: 'glyphicon glyphicon-ok',
				invalid: 'glyphicon glyphicon-remove',
				validating: 'glyphicon glyphicon-refresh'
			},
			fields: {
				form_email: {
					validators: {
						notEmpty: {
							message: 'Please give an email address'
						},
						emailAddress: {
							message: 'Sorry, that doesnt look like an email address yet'
						}
					}
				},
				form_message: {
					validators: {
						notEmpty: {
							message: 'Please leave a message'
						},
						stringLength: {
							min: 6,
							message: 'The message must be more than 6 characters'
						}
					}
				}
			}
		}).on('success.form.fv', function(e) {
			e.preventDefault();
			function centerModal() {
				$(this).css('display', 'block');
				var $dialog  = $(this).find(".modal-dialog"),
				offset       = ($(window).height() - $dialog.height()) / 2,
				bottomMargin = parseInt($dialog.css('marginBottom'), 10);

				if(offset < bottomMargin) offset = bottomMargin;
				$dialog.css("margin-top", offset);
			}

			$(document).on('show.bs.modal', '.modal', centerModal);
			$(window).on("resize", function () {
				$('.modal:visible').each(centerModal);
			});
			
			$.ajax({
				type: 'POST',
				url: '/wp-content/themes/davidnaso/lib/form/send/send.php',
				data: {
					post_id: 			$('#form-post-id').val(),
					email: 				$('#form-email').val(),
					email_retype: 		$('#form-email-retype').val(),
					message: 			$('#form-message').val()
				},
				dataType: 'json',
			})
			.done(function(data) {
				if(data.status == 'ok'){
					$('#form-success-message-modal').modal('show');
					$('#form-email').val('');
					$('#form-message').val('');
					$('#form').data('formValidation').resetForm();
				}else{
					$('#form-error-message-modal').modal('show');
				}
			}).fail(function(){
				$('#form-error-message-modal').modal('show');
			});
			return false;
		});
	}
});